import React from 'react'

import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const MyFoodlogs = (qty,Unit,food,Calories,date,id,isUser) => {
  const CustomTableCell = withStyles(theme => ({
    head: {
      backgroundColor: theme.palette.common.black,
      color: theme.palette.common.white,
    },
    body: {
      fontSize: 14,
    },
  }))(TableCell);
  
  const styles = theme => ({
    root: {
      width: '100%',
      marginTop: theme.spacing.unit * 3,
      overflowX: 'auto',
    },
    table: {
      minWidth: 700,
    },
    row: {
      '&:nth-of-type(odd)': {
        backgroundColor: theme.palette.background.default,
      },
    },
  });
    return (
      <Paper className={classes.root}>
        <Table className={classes.table}>
          <TableHead>
            <TableRow>
              <CustomTableCell>Quantity</CustomTableCell>
              <CustomTableCell align="right">Unit</CustomTableCell>
              <CustomTableCell align="right">Food (Unit)</CustomTableCell>
              <CustomTableCell align="right">Calories (g)</CustomTableCell>
              <CustomTableCell align="right">date</CustomTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
           
              <TableRow>
                <CustomTableCell align="right">qty</CustomTableCell>
                <CustomTableCell align="right">Unit</CustomTableCell>
                <CustomTableCell align="right">food</CustomTableCell>
                <CustomTableCell align="right">Calories</CustomTableCell>
                <CustomTableCell align="right">date</CustomTableCell>
              </TableRow>
  
          </TableBody>
        </Table>
      </Paper>
    );
  
}

export default MyFoodlogs
